import { Accordion, Row } from "react-bootstrap";

const QA = () => {
    return (
        <>
            <Row>

                <Accordion defaultActiveKey="0">
                    <Accordion.Item eventKey="0">
                        <Accordion.Header>
                            <div className="">السؤال الاول </div>
                        </Accordion.Header>
                        <Accordion.Body>
                            <div className="px-3">اجابة السؤال</div>
                        </Accordion.Body>
                    </Accordion.Item>

                </Accordion>
            </Row>
        </>
    )
}
export default QA;
